{
	"extends": ["eslint:recommended"],
	"parser": "@typescript-eslint/parser",
	"env": {
		"browser": true,
		"node": true
	},
	"plugins": ["compat", "import"],
	"settings": {
		"import/resolver": {
			"node": {
				"paths": [
					"packages/vue-styleguidist/src/client",
					"node_modules/react-styleguidist/lib/client"
				],
				"extensions": [".ts", ".tsx", ".js", ".d.ts"]
			}
		}
	},
	"rules": {
		"no-mixed-spaces-and-tabs": ["warn", "smart-tabs"],
		"compat/compat": "error",
		"import/export": "error",
		"import/no-named-as-default-member": "error",
		"import/no-mutable-exports": "error",
		"import/no-amd": "error",
		"import/first": ["error", "absolute-first"],
		"import/no-duplicates": "error",
		"import/extensions": [
			"error",
			"ignorePackages",
			{
				"js": "never",
				"ts": "never",
				"tsx": "never"
			}
		],
		"import/newline-after-import": "error",
		"import/no-named-default": "error"
	},
	"overrides": [
		{
			"files": ["packages/vue-styleguidist/src/client/**/*.*"],
			"extends": ["plugin:react/recommended"],
			"plugins": ["compat", "import"],
			"settings": {
				"import/resolver": {
					"node": {
						"paths": [
							"packages/vue-styleguidist/src/client",
							"node_modules/react-styleguidist/lib/client"
						],
						"extensions": [".ts", ".tsx", ".js", ".d.ts"]
					}
				}
			}
		},
		{
			"files": ["packages/**/*.{ts,tsx}"],
			"parserOptions": {
				"sourceType": "module",
				"ecmaVersion": 2015
			},
			"rules": {
				"no-unused-vars": 0,
				"no-console": "error"
			}
		},
		{
			"files": ["packages/vue-styleguidist/**/*.{ts,tsx}"],
			"parserOptions": {
				"ecmaVersion": 2018,
				"sourceType": "module"
			},
			"extends": ["tamia/typescript-react"],
			"plugins": ["@typescript-eslint"],
			"settings": {
				"import/resolver": {
					"typescript": {},
					"node": {
						"extensions": [".ts", ".tsx", ".js", ".d.ts"]
					}
				}
			},
			"rules": {
				"@typescript-eslint/no-use-before-define": "off",
				"@typescript-eslint/naming-convention": "off",
				"@typescript-eslint/no-unused-expressions": "off",
				"no-unused-vars": "off",
				"typescript/no-unused-vars": "off",
				"import/no-unresolved": "error",
				"import/no-extraneous-dependencies": "off"
			}
		},
		{
			"files": ["**/vue-docgen-api/**"],
			"env": {
				"es6": true
			},
			"rules": {
				"compat/compat": "off"
			}
		},
		{
			"files": ["test/setup.ts", "packages/**/*.{spec,test}.{vue3.,}{ts,tsx,js}"],
			"env": {
				"es6": true
			},
			"parserOptions": {
				"sourceType": "module",
				"ecmaVersion": 2015
			},
			"rules": {
				"compat/compat": "off",
				"no-unused-vars": 0
			},
			"globals": {
				"describe": false,
				"vi": false,
				"it": false,
				"test": false,
				"beforeAll": false,
				"expect": false,
				"beforeEach": false,
				"afterEach": false
			}
		},
		{
			"files": [
				"packages/**/*.cy.{ts,tsx,js}",
				"packages/**/*.cy.vue3.{ts,tsx,js}",
				"test/cypress/**/*.{ts,tsx,js}"
			],
			"parserOptions": {
				"sourceType": "module",
				"ecmaVersion": 2015
			},
			"plugins": ["cypress", "mocha"],
			"extends": ["plugin:cypress/recommended"],
			"rules": {
				"mocha/no-exclusive-tests": "error"
			}
		}
	]
}

{
	"printWidth": 100,
	"singleQuote": true,
	"trailingComma": "none",
	"useTabs": true,
	"proseWrap": "never",
	"semi": false,
	"arrowParens": "avoid",
	"overrides": [
		{
			"files": "*.md",
			"options": {
				"printWidth": 70,
				"useTabs": false,
				"semi": false,
				"trailingComma": "none"
			}
		}
	]
}

