        },

        ecmaVersion: 2015,
        sourceType: "module",
    },

    rules: {
        "compat/compat": "off",
        "no-unused-vars": 0,
    },
}, ...compat.extends("plugin:cypress/recommended").map(config => ({
    ...config,

    files: [
        "packages/**/*.cy.{ts,tsx,js}",
        "packages/**/*.cy.vue3.{ts,tsx,js}",
